Gree + brings you a brand new experience for intelligent control. As a new official application software that Gree  develops specially for IoT era, it has the functions of appliances management, intelligent control, etc., which makes your life much easier.  

Function introductions:
1、Intelligent products can be easily added into Gree ecosystem for intelligent management uniformly;
2、You can control the appliance at anytime and anywhere you like;
3、You can know the status of the appliance in real time and all changes of appliance status will be reported to you immediately。

VIEW Product is designed for the remote management of connected products, including Wi-Fi cameras, Adaptors and multi-sockets, and stay up-to-date of what’s new from Vimar via push notifications. 
You can also: 
• easily add a new device using the QR code; 
• view the live streaming or footage recorded by the cameras; 
• store images and videos directly on your smartphone; 
• choose which socket outlets to turn on and off and for how long; 
• view the historic consumption of connected appliances; 
• receive immediate notifications if a device is off line or has no power supply; 
• make the connected products perform automatic actions (scenarios or automations) depending on specific conditions, without human intervention, even using geolocation.

